import React from "react";
import { Link } from "react-router-dom";
import estilos from "./LandingPage.module.css";

export default function LandingPage() {
  return (
    <div className={estilos.landing}>
      <Link to="/home">
        <button>START</button>
      </Link>
    </div>
  );
}
